        //editor.defaultPasteOption = 'PasteAsRow';
        editor.editor.copiedContent = multipleRow;
        (editor.editorModule as any).copiedTextContent = "InsertRow";
        editor.editor.applyTablePasteOptions('InsertAsRows');
        let tableWidget: TableWidget = editor.documentHelper.pages[0].bodyWidgets[0].childWidgets[0] as TableWidget;
        expect(tableWidget.childWidgets.length).toBe(6);
