describe('Pasting List content validation', () => {
    let container: DocumentEditorContainer;
    let element: HTMLElement;
    beforeAll(() => {
        element = createElement('div');
        document.body.appendChild(element);
        DocumentEditorContainer.Inject(Toolbar);
        container = new DocumentEditorContainer({ showPropertiesPane: false, enableLocalPaste: true });
        container.appendTo(element);
    });
    afterAll(() => {
        container.destroy();
        expect(element.childNodes.length).toBe(0);
        document.body.removeChild(element);
        expect(() => { container.destroy(); }).not.toThrowError();
        element = undefined;
        container = undefined;
        document.body.innerHTML = '';
    });
    it('To check list pattern is pasted properly', () => {
        console.log('To check list pattern is pasted properly');
        let editor: DocumentEditor = container.documentEditor;
        editor.openBlank();
        editor.open(file);
        //editor.enableLocalPaste = true;
        (editor.editorModule as any).selection.selectAll();
        (editor.editorModule as any).selection.copy();
        (editor.editorModule as any).selection.handleRightKey();
        editor.editorModule.paste();
        editor.selection.moveToPreviousParagraph();
        editor.selection.moveToPreviousParagraph();
        expect((editor.selection.start.currentWidget.children[0] as ListTextElementBox).text).toBe("(B)");
        editor.selection.moveToPreviousParagraph();
        expect((editor.selection.start.currentWidget.children[0] as ListTextElementBox).text).toBe("02.");
    });
});
